import React from "react";
import Swiper from "swiper";
import { SwiperSlide } from "swiper/react";

const Item = ({ item, setProduct }) => {
  // setArr(item);
  // arr==='center'? setProduct(item): null;

  return (
    <div>
      <Swiper
        spaceBetween={50}
        slidesPerView={1}
        onSlideChange={(e) => console.log(e.activeIndex)}
        onSwiper={(swiper) => console.log(swiper)}
      >
        {" "}
        <SwiperSlide>{item.id}</SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Item;
